import { Injectable } from '@angular/core';

export interface TVShow {
  title: string;
  genre: string;
  imageUrl: string;
}

@Injectable({
  providedIn: 'root'
})
export class TvShowListService {
  private tvShowList: TVShow[] = [
    { title: 'Breaking Bad', genre: 'Drama', imageUrl: 'data:image/jpeg;base64,' },
    { title: 'Stranger Things', genre: 'Science Fiction', imageUrl: 'data:image/jpeg;base64,' },
    { title: 'The Office', genre: 'Comedy', imageUrl: 'data:image/jpeg;base64,' },
  ];

  constructor() { }

  getTvShowList(): TVShow[] {
    return this.tvShowList;
  }

  addTvShow(tvShow: TVShow) {
    this.tvShowList.push(tvShow);
  }

  removeTvShow(index: number) {
    this.tvShowList.splice(index, 1);
  }
}
